void wait_for_vsync() {
    *(pixel_ctrl_ptr) = 1;
    int status = (*(pixel_ctrl_ptr +3)) & 0b1;
    //poll status
    while(status) {
        status = (*(pixel_ctrl_ptr +3)) & 0b1;
    }
    //ready to swap
    //swap buffers
}

