void main(void)
{
  short int moveRow, moveCol;
  char startedMove = 0;
  char startingRow, startingCol;
  char finalRow, finalCol;
  char moveLegal = 0;
  volatile unsigned int* LEDs = (int*) LED_BASE;
  *(LEDs) = (int)2;
  
  /* set front pixel buffer to Buffer 1 */
  *(pixel_ctrl_ptr + 1) = (int) &Buffer1; // first store the address in the  back buffer
  /* now, swap the front/back buffers, to set the front buffer location */
  wait_for_vsync();
  /* initialize a pointer to the pixel buffer, used by drawing functions */
  pixel_buffer_start = (int) *pixel_ctrl_ptr;
  clear_screen(); // pixel_buffer_start points to the pixel buffer
  char moveValid = 0;
  /* set back pixel buffer to Buffer 2 */
  *(pixel_ctrl_ptr + 1) = (int) &Buffer2;
  pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
  clear_screen(); // pixel_buffer_start points to the pixel buffer
  setupMouse();
  setupTimer();
  setupInterrupts();
  resetAudio();
  
  while (1) {   
      //draw board
    switch(screenNum){
      case 0: {
        drawStartingScreen();
        drawWinner();
        if(mousePressed) {
          screenNum = 1;
          mousePressed = 0;
          setupMouse();
        }
        break;
      }
      case 1: {
        clear_screen();
        drawBoard();
        drawPieces();
        if(startedMove == 1) {
          drawSelection(startingRow, startingCol, YELLOW);
          for(int i = 0; i < 8; i++) {
            for(int j = 0; j < 8; j++) {
              if(stored_moves[i][j] == 'x') {
                drawSelection(i, j, BLUE);
              }
            }
          }
        }
        drawMouse();
        if(mousePressed) {
            getMove(&moveRow, &moveCol); //get the move position
            checkMove(moveRow,moveCol,colour, &moveValid, startedMove); //check if there is a piece in that postion if just starting move
            if(moveValid == 1 && startedMove == 0) {
                startingRow = moveRow;
                startingCol = moveCol;
                startedMove = 1;
                genPotentialMoves(moveRow, moveCol);
            }
            else if(moveValid == 1 && startedMove == 1 && undoMove != 1) {
                finalRow = moveRow;
                finalCol = moveCol;
                checkLegality(finalRow, finalCol, &moveLegal);
                if(moveLegal) {
                  if(Board[finalRow][finalCol] != 'o') {
                    soundType = CAPTUREsound;
                  }
                  else {
                    soundType = MOVEsound;
                  }
                  update_board(startingRow, startingCol, finalRow, finalCol);
                  if(is_checked(king_row, king_col)) {
                    soundType = CHECKsound;
                  }
                  
                  printf("MoveSound:%d CaptureSound: %d", (soundType == MOVEsound), (soundType == CAPTUREsound));

                  enableAudio();
                  colour = colour == WHITE? BLACK: WHITE;//change colour
                  //printf("%d",check_endgame());
                  if(check_endgame() == true) {
                    gameOver = 1;
                    //printf("Game is over");
                  }
                  startedMove = 0;
                }
                else {
                  startedMove = 1;
                }
            }
            else if(undoMove == 1 && startedMove == 1) {
                startedMove = 0;
                undoMove = 0;
            }
            mousePressed = 0;
            setupMouse();//enable interrupts from mouse
        }
        if(gameOver == 1) {
          resetGame();
        }
        break;
      }
    }
    //make sure to enable interrupts for mouse after
    wait_for_vsync(); // swap front and back buffers on VGA vertical sync
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer	
	}
}


/* The assembly language code below handles CPU exception processing. This
 * code should not be modified; instead, the C language code in the function
 * interrupt_handler() can be modified as needed for a given application.
*/
void the_exception(void) __attribute__((section(".exceptions")));
void the_exception(void)
/*******************************************************************************
 * Exceptions code. By giving the code a section attribute with the name
 * ".exceptions" we allow the linker program to locate this code at the proper
 * exceptions vector address.
 * This code calls the interrupt handler and later returns from the exception.
 ******************************************************************************/
{
asm("subi sp, sp, 128");
asm("stw et, 96(sp)");
asm("rdctl et, ctl4");
asm("beq et, r0, SKIP_EA_DEC"); // Interrupt is not external
asm("subi ea, ea, 4"); /* Must decrement ea by one instruction
                                        * for external interupts, so that the
                                        * interrupted instruction will be run */
asm("SKIP_EA_DEC:");
asm("stw r1, 4(sp)"); // Save all registers 
asm("stw r2, 8(sp)");
asm("stw r3, 12(sp)");
asm("stw r4, 16(sp)");
asm("stw r5, 20(sp)");
asm("stw r6, 24(sp)");
asm("stw r7, 28(sp)");
asm("stw r8, 32(sp)");
asm("stw r9, 36(sp)");
asm("stw r10, 40(sp)");
asm("stw r11, 44(sp)");
asm("stw r12, 48(sp)");
asm("stw r13, 52(sp)");
asm("stw r14, 56(sp)");
asm("stw r15, 60(sp)");
asm("stw r16, 64(sp)");
asm("stw r17, 68(sp)");
asm("stw r18, 72(sp)");
asm("stw r19, 76(sp)");
asm("stw r20, 80(sp)");
asm("stw r21, 84(sp)");
asm("stw r22, 88(sp)");
asm("stw r23, 92(sp)");
asm("stw r25, 100(sp)");
asm("stw r26, 104(sp)");
// skip r27 because it is sp, and there is no point in saving this
asm("stw r28, 112(sp)");
asm("stw r29, 116(sp)");
asm("stw r30, 120(sp)");
asm("stw r31, 124(sp)");
asm("addi fp, sp, 128");
asm("call  interrupt_handler");
asm("ldw r1, 4(sp)"); // Restore all registers 
asm("ldw r2, 8(sp)");
asm("ldw r3, 12(sp)");
asm("ldw r4, 16(sp)");
asm("ldw r5, 20(sp)");
asm("ldw r6, 24(sp)");
asm("ldw r7, 28(sp)");
asm("ldw r8, 32(sp)");
asm("ldw r9, 36(sp)");
asm("ldw r10, 40(sp)");
asm("ldw r11, 44(sp)");
asm("ldw r12, 48(sp)");
asm("ldw r13, 52(sp)");
asm("ldw r14, 56(sp)");
asm("ldw r15, 60(sp)");
asm("ldw r16, 64(sp)");
asm("ldw r17, 68(sp)");
asm("ldw r18, 72(sp)");
asm("ldw r19, 76(sp)");
asm("ldw r20, 80(sp)");
asm("ldw r21, 84(sp)");
asm("ldw r22, 88(sp)");
asm("ldw r23, 92(sp)");
asm("ldw r24, 96(sp)");
asm("ldw r25, 100(sp)");
asm("ldw r26, 104(sp)");
asm("ldw r28, 112(sp)");
asm("ldw r29, 116(sp)");
asm("ldw r30, 120(sp)");
asm("ldw r31, 124(sp)");
asm("addi sp, sp, 128");
asm("eret");
}

void setupMouse() {
	volatile int* PS2_ptr = (int *)PS2_BASE; 
	*(PS2_ptr) = 0xFF;
	*(PS2_ptr+1) = 1; //enable interrupt
}

void mouse_ISR() {
	volatile int* PS2_ptr = (int *)PS2_BASE; 
	int PS2_data, RVALID;
	volatile int* LEDs = (int *)LED_BASE;
	char byte1, byte2, byte3;
    byte1 = (char)((mouseBuffer & 0xFF0000) >> 16);
    byte2 = (char)((mouseBuffer & 0xFF00) >> 8);
    byte3 = (char) (mouseBuffer & 0xFF);

	PS2_data = *(PS2_ptr); // read the Data register in the PS/2 port 
	RVALID = PS2_data & 0x8000; // extract the RVALID field
	if (RVALID) {
	/* shift the next data byte into the display */
		byte1 = (char)byte2;
		byte2 = (char)byte3;
		byte3 = (char)(PS2_data & 0x0FF);
		if ((byte2 == (char)0xAA) && (byte3 == (char)0x00)) // mouse inserted; initialize sending of data 
			*(PS2_ptr) = 0xF4;
		else if(byte1 == 0x8 || byte1 == 0x18 || byte1 == 0x28 || byte1 == 0x38) {
			if((mousex != 319 || byte2 < 0 )&&(mousex != 0 || byte2 > 0)) {
				mousex += byte2;
			}
			if((mousey != 239 || byte3 > 0 )&&(mousey != 0 || byte3 < 0)) {
				mousey -= byte3;
			}
			mouseBuffer = 0;
		}
		else if(byte1 == 0x9 || byte1 == 0x19 || byte1 == 0x29 || byte1 == 0x39) {
			if((mousex != 319 || byte2 < 0 )&&(mousex != 0 || byte2 > 0)) {
				mousex += byte2;
			}
			if((mousey != 239 || byte3 > 0 )&&(mousey != 0 || byte3 < 0)) {
				mousey -= byte3;
			}
			mousePressed = 1;
			*(PS2_ptr+1) = 0;
			mouseBuffer = 0;
			//move has been selected
		}
		else if(byte1 == 0xA || byte1 == 0x1A || byte1 == 0x2A || byte1 == 0x3A) {
			mousePressed = 1;
			mouseBuffer = 0;
			*(PS2_ptr+1) = 0;
			undoMove = 1;

		}	//for checking if right clicker is pressed in that case reset their move
		else {
			mouseBuffer = ((byte1&0xFF) << 16) + ((byte2&0xFF) << 8) + (byte3&0xFF);
		}
	}
	return;
}

void getMove(short int* moveRow, short int* moveCol) {
   mousex = (int) (mousex & 0x1FF);
   mousey = (int) (mousey & 0xFF);
    if (mousex < 39 || mousex > 279) {
        return;
    }
   *moveCol = (short int)((mousex - 39) / WIDTH);
   *moveRow = (short int)(mousey / HEIGHT);
   return;
}

void checkMove(short int moveRow, short int moveCol, char colour, char* moveValid, char startedMove) {
    if(startedMove == 0) {//selecting a starting position for move
        switch(colour) {
            case BLACK: {
                if(Board[moveRow][moveCol] > 'A' && Board[moveRow][moveCol] < 'Z' && Board[moveRow][moveCol] != 'o') {
                    *(moveValid) = 1;
                }
                else {
                    *(moveValid) = 0;
                }
                break;
            }

            case WHITE: {
                if(Board[moveRow][moveCol] > 'a' && Board[moveRow][moveCol] < 'z' && Board[moveRow][moveCol] != 'o') {
                    *(moveValid) = 1;
                }
                else {
                    *(moveValid) = 0;
                }
                break;
            }
        }
    }
    else {//already selected starting position
        *(moveValid) = 1;
    }
    return;
}


void interrupt_handler(void) { 
    int ipending;
    NIOS2_READ_IPENDING(ipending);
    if (ipending & 0x80) // PS2 mouse is interrupt level 7 
    {
        mouse_ISR();
    }
    else if(ipending & 0x1) {// else, ignore the interrupt
        timer_ISR();
    } 
    else if(ipending & 0x40) {
        audio_ISR();
    }
    return; 
}

void setupInterrupts() {
    NIOS2_WRITE_IENABLE(0xC1);
    NIOS2_WRITE_STATUS(1);
    return;
}

void setupTimer() {//puts 1 second back on the timer
    volatile int * interval_timer_ptr = (int *)TIMER_BASE;
    *(interval_timer_ptr) = 0; // clear the interrupt
    int counter = 100000000; // 1/(50 MHz) x (2500000) = 50 msec
    *(interval_timer_ptr + 0x2) = (counter & 0xFFFF);
    *(interval_timer_ptr + 0x3) = (counter >> 16) & 0xFFFF;
    *(interval_timer_ptr + 1) = 0x7;//turn on start and CONT

}

void HEX_PS2(char b1, char b2, char b3) {
	volatile int * HEX3_HEX0_ptr = (int *)HEX3_HEX0_BASE; 
	volatile int * HEX5_HEX4_ptr = (int *)HEX5_HEX4_BASE;
	unsigned char seven_seg_decode_table[] = {0x3F, 0x06, 0x5B, 0x4F, 0x66, 0x6D, 0x7D, 0x07,
	0x7F, 0x67, 0x77, 0x7C, 0x39, 0x5E, 0x79, 0x71}; 
	unsigned char hex_segs[] = {0, 0, 0, 0, 0, 0, 0, 0}; 
	unsigned int shift_buffer, nibble;
	unsigned char code;
	int i;
	shift_buffer = ((b1&0xFF) << 16) | ((b2&0xFF) << 8) | (b3&0xFF); 
	for (i = 0; i < 6; ++i) {
		nibble = shift_buffer & 0x0000000F; // character is in rightmost nibble 
		code = seven_seg_decode_table[nibble];
		hex_segs[i] = code;
		shift_buffer = shift_buffer >> 4;
	}
    /* drive the hex displays */
	*(HEX3_HEX0_ptr) = *(int *)(hex_segs);
	*(HEX5_HEX4_ptr) = *(int *)(hex_segs + 4); 
}

void timer_ISR() {
    volatile int * interval_timer_ptr = (int *)TIMER_BASE;
    *(interval_timer_ptr) = 0; // clear the interrupt
    if(screenNum == 0) {
		return;
	}
	if(colour == WHITE){
        if(whiteTime == 0) {
			whiteTime = 60*10;
			gameOver = 1;
		}
		whiteTime -= 1;
    }
    else {
		if(blackTime == 0) {
			blackTime = 60*10;
			gameOver = 1;
		}
        blackTime -= 1;
    }
    displayTime();
}

void displayTime() {
    int minutes, secondsTens, seconds;
	if(colour == WHITE) {
		minutes = whiteTime / 60;
		secondsTens = (whiteTime - (minutes*60)) / 10;
		seconds = (whiteTime - (minutes*60) - (secondsTens*10));
	}
	else {
		minutes = blackTime / 60;
		secondsTens = (blackTime - (minutes*60)) / 10;
		seconds = (blackTime - (minutes*60) - (secondsTens*10));
	}
    char byte1, byte2, byte3;
    byte1 = ((minutes&0xF));
    byte2 = ((secondsTens & 0xF) << 4) | (seconds&0xF);
	byte3 = 0;
    HEX_PS2(byte1, byte2, byte3);
    return;
}

